import React from 'react';
import Rainbow from '../hoc/Rainbow';


const uyelik = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
                <div class="btn-group" data-toggle="buttons">
  <label class="btn btn-sm btn-success active">
    <input type="radio" name="mergeType" id="radio1" value="OVW">Überschreiben</input>
  </label>
  <label class="btn btn-sm btn-success">
    <input type="radio" name="mergeType" id="radio2" value="ADD" checked>Hinzufügen</input>
  </label>
  <label class="btn btn-sm btn-success">
    <input type="radio" name="mergeType" id="radio3" value="KEE">Gefunde behalten</input>
  </label>
  <label class="btn btn-sm btn-success">
    <input type="radio" name="mergeType" id="radio4" value="DEL">Gefundene entfernen</input>
  </label>
</div>

		</div>
	)
}


export default Rainbow(uyelik);
